This section is going to use a slightly more complex contract in order to showcase failures and how to test them. Even if you are not familiar with liquidity , the contract's code will most likely be more readable in liquidity than in michelson. Here is the liquidity version, admins.liq : [%%version 0.405] type storage = { admins : (string, address) map ; (* Unused in this example. *) nus : (string, (address * tez * UnitContract.instance)) map ;
} let admin_check (storage : storage) (name : string) (a : address) : unit = match Map.find name storage.admins with | None -> failwith "only admins can perform administrative tasks" | Some address -> if address <> a then failwith "illegal access to admin account" let%entry add_admin ((admin_name, nu_name, nu_address) : string * string * address) (storage : storage) : operation list * storage = admin_check storage admin_name (Current.sender ()); let storage = storage.admins <- Map.update nu_name (Some nu_address) storage.admins in [], storage Note that the clients field of the storage is unused in this example. The admins map maps administrator names to addresses. The only entry point (in this example) is add_admin which allows administrators to add new administrators by registering their name and their address. More precisely, calling this contract is only legal if the SENDER ( Current.sender () ) of the call is an administrator ( c.f. admin_check ). If the call to the contract is not legal, the transfer fails: let admin_check (storage : storage) (name : string) (a : address) : unit = match Map.find name storage.admins with | None -> failwith "only admins can perform administrative tasks" | Some address -> if address <> a then failwith "illegal access to admin account" The parameters of the entry point are admin_name : name associated with the SENDER administrator, nu_name : name of the new administrator to add, nu_address : the address of the new administrator. let%entry add_admin ((admin_name, nu_name, nu_address) : string * string * address) Using liquidity to compile the contract to michelson (for instance using liquidity's online editor ), we obtain admins.tz . Here are the storage and parameter types: parameter (pair string (pair string address));
storage (pair :storage (map %admins string address) (map %clients string (pair address (pair mutez (contract :UnitContract unit))))); We omit the contract's code ( admins.tz ) as i) it is not very readable and ii) we do not need to know what the code precisely is to create the contract and call it, as long as we know the storage and parameter types.

